import Header from "../../components/Header";
import Sidebar from "../../components/sidebar/Sidebar";

export default function Empty() {
  return (
    <div>
      <Header />
      <main className="main">
        <Sidebar />
        <section className="empty"></section>
      </main>
    </div>
  );
}
